import React from 'react';

class GameGenreType extends React.Component {
    constructor(props) {
      super(props);

      const  GenreID =
        [
          { id: 'RG', display: 'Racing Game' },
          { id: 'AG', display: 'Action Game' },
          { id: 'FPSG', display: 'FPS Game' },
        ];
    }
  
    render() {
      return (
        <button className="GameGenreType" onClick={() => console.log('click')}>
          {this.props.value}
        </button>
      );
    }
  }

  export default GameGenreType;
